import React from "react";
import ShowUsers from "./ShowUsers";

function AllUsers({ users }) {
  return (
    <div>
      {users.map((x, i) => (
        <ShowUsers key={i} user={x} />
      ))}
    </div>
  );
}

export default AllUsers;
